Felt good to pop 🍾 again! P3 OA and back on the box at Ironman. A massive thanks to my @ktmusa @ktmfactoryracing team for never giving up and getting me dialed in. It was nice to make passes and lead laps this week and my fastest lap in the races with two laps to go in Moto 2 shows my fitness is where it needs to be. 2 to go… let’s keep it rolling 💪🏽

